import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import '../css/Header.css';
import '../css/Fade.css';


export class HeaderName extends Component {

    render() {

        this.state = {
            value: "Matthew Cline's Resume"
        }
        setState()

        return ( <div className="HeaderName">{this.state.value}</div> );
    }
}


export default class Header extends Component {


    componentDidMount () {
        document.addEventListener("DOMContentLoaded", function(event) {
          //Load up the various modules
          ReactDOM.render(<HeaderName />, document.getElementById('HeaderBackground'));
        });
    }

    render() {
        return (
            <div className="Header fade-in">
                <div className="HeaderBackground">
                    <div className="HeaderName">{this.state.value}</div>
                </div>
            </div>
        );
    }
}
